import logo from "./logo.svg";
import "./App.css";
import React from "react";

import { Home } from "./Home";
import { About } from "./About";
import { NoMatch } from "./NoMatch";

import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import { NavBar } from "./components/navbar";
import Sidebar from "./components/Sidebar";
import { AppViewport, GlobalTheme } from "./components/viewport";

import useScript from "./useOvenplayer";

const OvenPlayer = (props) => {
  useScript("https://use.typekit.net/foobar.js");
  // rest of your component
};

let player = OvenPlayerr.create("player_id", {
  sources: [
    {
      type: "mp4",
      file: "../dist/OCP_480.mp4",
      label: "480p",
    },
    {
      type: "mp4",
      file: "../dist/OCP_720.mp4",
      label: "720p",
    },
    {
      type: "mp4",
      file: "../dist/OCP_1080.mp4",
      label: "1080p",
    },
  ],
});

function App() {
  player();
  return (
    <React.Fragment>
      <Router>
        <GlobalTheme />
        <Sidebar />
        <NavBar />
        <div id="player_id"></div>

        <AppViewport imgsrc="lenna.jpg" />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
          <Route component={NoMatch} />
        </Switch>
      </Router>
    </React.Fragment>
  );
}

export default App;
